HQ very rare promo music video from a promo DVD. &quot;&quot; is a song from Stone Cold Rhymin',  the debut album by rapper Young MC. It was originally released in 1989 on Delicious Vinyl and was later re-issued by Rhino Records. The third track, &quot;Bust a Move&quot;, was Young MC's biggest hit and is his most well known song. 

Marvin Young (born May 10, 1967), better known by his stage name Young MC, is an English-born American singer, rapper and actor. His debut album Stone Cold Rhymin' found international acclaim; however, subsequent albums have not reached the same level of success. Young has also appeared in film in acting roles and cameo appearances and has appeared in several television programs. His family left England and moved to Queens, New York when he was eight years old. 

Young attended Hunter College High School in the Upper East Side of Manhattan. He went on to earn a degree in economics from the University of Southern California (USC). At USC he met Michael Ross and Matt Dike from the record company Delicious Vinyl. Young rapped over the phone for Ross and Dike, who ended up delivering a record contract to his USC dorm room. In 1989, Young collaborated with Tone Loc on the songs &quot;Wild Thing&quot; and &quot;Funky Cold Medina&quot;. Young gained fame with the release of his single &quot;Bust a Move&quot;, which reached No. 7 on the Billboard Hot 100, topped the charts in Australia and won a Grammy for Best Rap Performance. The single helped Young's debut album, Stone Cold Rhymin', to reach No. 9 on the Billboard 200 and attain platinum status in the US. The follow-up single, &quot;Principal's Office&quot;, reached No. 33 on the Billboard Hot 100 and was nominated for Best Rap Video at the 1990 MTV Video Music Awards.
